import React from "react";
import { useEffect, useState } from "react";

const EncounterPageOne = () => {
  const [firstEncounter, setFirstEncounter] = useState({});

  useEffect(() => {
    fetch("/api/encounters/2")
      .then((resp) => resp.json())
      .then((encounter) => setFirstEncounter(encounter));
  }, []);

  let encounterClass = firstEncounter.encounter_class;

  const encounterDesc = (expr) => {
    switch (expr) {
      case "Terrain":
        return (
          <div id="encounter-one">
            <h2>{firstEncounter.encounter_name}</h2>
            <p>{firstEncounter.encounter_desc}</p>
          </div>
        );

    }
  };

  return encounterDesc();
};

export default EncounterPageOne;
